# Commented out IPython magic to ensure Python compatibility.
#importar modulos relevantes
import os, sys, time
import numpy as np            #para trabajar con arrays
from astropy.io import fits    #para leer el archivo
from astropy import wcs         #para tener las coordenadas
from astropy.nddata.utils import Cutout2D    #para hacer un recorte de la imagen más manejable
import matplotlib.pyplot as plt
from matplotlib.patches import Ellipse
from astropy.visualization import (AsinhStretch, LogStretch, ImageNormalize, LinearStretch)
from scipy.interpolate import interp1d, interp2d     #nos va a ayudar para deproyectar la imagen
from matplotlib.gridspec import GridSpec

# %matplotlib inline
#es un metodo para que los graficos se ejecuten a la par con las celdas

# parametros para plots
import matplotlib as mpl   #acá establecemos las indicaciones para todos nuestros gráficos a continuación
mpl.rc('xtick.major', size=5, pad=3, width=2)
mpl.rc('ytick.major', size=5, pad=3, width=2)
mpl.rc('xtick.minor', size=2, pad=3, width=2)
mpl.rc('ytick.minor', size=2, pad=3, width=2)
mpl.rc('axes', linewidth=2, labelsize=14, titlesize=18)
mpl.rc('legend', fontsize=14)
mpl.rc('lines', markersize=5)
mpl.rc('font', size=12)
cmap = 'inferno'

# nombre del disco a analizar
disk_name = 'IMLup'

# propiedades geometricas (de Huang et al. 2018 DSHARP II)
offRA, offDEC = -0.001, +0.001
incl, PA = 47.5, 144.5        #datos de la tabla 2 de Huang et al
inclr, PAr = np.radians(incl), np.radians(PA)
rout = 1.2

"""Estas propiedades esenciales, por ejemplo PAr es el angulo en que debemos rotar nuestra imagen, y la inclinacion incl nos permiten 'aplanarlo' respecto a como lo vemos en el cielo, abajo adjunto una imagen de la tabla en cuestion.

![tabla2_Huang_et_al.png](data:image/png;base64,)
"""

# abrir imagen .FITS
hdu = fits.open('IMLup_continuum.fits')
data = 1e3 * np.squeeze(hdu[0].data) #pasamos la imagen de Jy a mJy (no es necesario pero util)
header = hdu[0].header
w = wcs.WCS(header)
w_ra_dec = w.sub(2)
# verificar tamaño 4000x4000
print(data.shape)

# recortar la imagen para facilitar su analisis
cutout = Cutout2D(data, (2000, 2000), (1000, 1000), wcs=w_ra_dec)
image = cutout.data
print(image.shape)

# es OK que aparezca un warning en esta etapa ya que estamos cambiando propiedades de la imagen y el "header" se tiene que adaptar

subhd = cutout.wcs.to_header()
ny, nx = image.shape     #creamos los ejes para la imagen
RAo = 3600 * subhd['CDELT1'] * (np.arange(nx) - (subhd['CRPIX1'] - 1))    #las coordenadas originales RAo
DECo = 3600 * subhd['CDELT2'] * (np.arange(ny) - (subhd['CRPIX2'] - 1))   #y DECo
RAo_shift, DECo_shift = RAo - offRA, DECo - offDEC

# resolucion de la imagen ('beam')
freq = header['CRVAL3']
beam_maj, beam_min, beam_PA = 3600 * header['BMAJ'], 3600 * header['BMIN'], header['BPA']
beam_area = (np.pi * beam_maj * beam_min / (4 * np.log(2))) / (3600 * 180 / np.pi)**2

"""El codigo que esta justo arriba tambien es de suma importancia ya que desde aqui ya tenemos la imagen recortada para trabajar de aqui en adelante y establecemos las coordenadas"""

#image setups
im_bounds = (RAo_shift.max(), RAo_shift.min(), DECo_shift.min(), DECo_shift.max())
dRA_lims, dDEC_lims = [rout, -rout], [-rout, rout]

# intensity limits, and stretch
vmin, vmax = 0.0, 4.0    # these are in mJy/beam units
norm = ImageNormalize(vmin=vmin, vmax=vmax, stretch=AsinhStretch(0.03))       # Vmin y vmax nos dan la intensidad para la imagen
#norm = ImageNormalize(vmin=vmin, vmax=vmax, stretch=LinearStretch(10))
#me imagino   que el stretch es una congiguración para el mismo contraste que adquieren los pixeles de la imagen con el vmin y vmax
#entre ellos estan los importados al principio, hay variosmetodos pero el que mejor funciona es el que dejamos puesto

# image plot
fig, ax = plt.subplots(figsize=(10, 8))
im = ax.imshow(image, origin='lower', cmap=cmap, extent=im_bounds, norm=norm, aspect='equal')  #aquí se grafica la imagen recortada
#con el cmap elegido la normalización que nos da las intensidades de los pixeles que nos convienen

# minor and major axes
rmaj = np.linspace(-rout, rout, 2)
ax.plot(rmaj * np.sin(PAr), rmaj * np.cos(PAr), '--w', alpha=0.7)  #aquí se grafican las líneas que corresponden a los ejes, (ESTE ES EL MAYOR)
ax.plot(rmaj * np.cos(inclr) * np.sin(PAr - 0.5*np.pi),      #no se muy bien porque las indicaciones son con estos angulos raros (ESTE ES EL MENOR)
        rmaj * np.cos(inclr) * np.cos(PAr - 0.5*np.pi), '--w', alpha=0.7)
#pero el hecho es que esto define las lineas que indican la posición de los ejes menor y mayor


# limits, labeling
ax.set_xlim(dRA_lims)
ax.set_ylim(dDEC_lims)
ax.set_xlabel('RA offset [arcsec]')
ax.set_ylabel('DEC offset [arcsec]')

# scalebar
cb = plt.colorbar(im, ax=ax, pad=0.05)
cb.set_ticks([0, 0.2, 0.5, 1.0, 2.0])
cb.set_label('surface brightness [mJy / beam]', rotation=90, labelpad=17)

# beam
beam = Ellipse((dRA_lims[0] + 0.1*np.diff(dRA_lims), dDEC_lims[0] + 0.1*np.diff(dDEC_lims)),
                beam_maj, beam_min, 90-beam_PA)
beam.set_facecolor('w')
ax.add_artist(beam)

# adjust layout
fig.subplots_adjust(left=0.13, right=0.93, bottom=0.13, top=0.98)

"""## **Parte 2 y 3 Rotar y deproyectar la imagen**"""

#ANtes de hacer el proceso pixel por pixel de la rotacion, vemos como nos
#deberia quedar
from scipy.ndimage import rotate as rt
ri= rt(image,PA,reshape=True)


fig, ax = plt.subplots(figsize=(8, 6))
im = ax.imshow(ri, origin='lower', cmap=cmap, extent=im_bounds, norm=norm, aspect='equal')

"""Ahora procedemos a hacer la rotacion y deproyeccion pixel por pixel"""

# Primero buscamos los indices y las dimensiones

alto = ancho = 1001   #partimos considerando con 1001 en vez de 1000_
#para evitar tener problemas de indexacion mas adelante en el loop
cx = ancho//2
cy= ancho//2
# Creamos una función de interpolación para la imagen original
interp_func = interp2d(RAo_shift, DECo_shift, image, kind='linear',fill_value=0)

#esta funcion toma parametros x,y z que en nuestro caso son los arrays
# generados RAo_shift, DECo_shift y la imagen que nos permiten aproximar una funcion

rotated_image = np.zeros((ancho,alto))   #aqui creamos una matriz de 1001 por 1001
delta_disco= 3600*subhd['CDELT2']    #aqui se describe el incremento en las coordenadas del disco_
# -para la subimagen y se multiplica para que este en grados 60min *60s

xdisco= (np.arange(ancho)-cx)*-delta_disco    #Aqui definimos el delta para x e y
ydisco= (np.arange(alto)-cy)*delta_disco     # el menos es porque CDELT1 es negativo

# Loop sobre cada píxel en la subimagen
for y in range(alto):
    for x in range(ancho):

        # Aplicar la rotación inversa
        x_rot = xdisco[x] * np.cos(PAr)*np.cos(inclr) + ydisco[y] * np.sin(PAr)
        y_rot = -xdisco[x]* np.sin(PAr)*np.cos(inclr) + ydisco[y] * np.cos(PAr)

        rotated_image[y, x] = interp_func(x_rot, y_rot)

bounds= (xdisco.max(),xdisco.min(),ydisco.min(),ydisco.max())

x_lim,y_lim= [rout,-rout],[-rout,rout]

"""La recomendacion anterior que surge como output es usar una funcion de scipy distinta a interp2d porque esta obsoleta y se va a sacar el la proxima version de scipy."""

#GRAFIcamos
plt.figure(figsize=(12, 6))
plt.subplot(1, 2, 1)
plt.ylabel('DEC offset [arcsec]')
plt.xlabel('RA offset [arcsec]')
plt.imshow(image, origin='lower', cmap=cmap, extent= im_bounds, norm=norm, aspect='equal')
plt.title('Subimagen Original')

plt.subplot(1, 2, 2)
plt.imshow(rotated_image, origin='lower', cmap=cmap, extent= bounds, norm=norm, aspect='equal')
plt.xlim(x_lim)
plt.ylim(y_lim)
plt.xlabel('RA offset [arcsec]')
plt.ylabel('DEC offset [arcsec]')
plt.title('Imagen Rotada y Deproyectada')

plt.show()

"""En la imagen anterior podemos comparar la imagen original versus a la imagen rotada y deproyectada, el resultado: una imagen de cara a nosotros con los ejes alineados segun el PA

## **Parte 4 y 5 (coordenadas polares y perfil radial)**
En esta parte dejo incluido el primer intento (que tiene ciertos errores)y la version definitiva siguiendo del procedimiento sugerido que es más eficaz y con menos lineas de código.
"""

#INTENTO 1
from scipy.ndimage import map_coordinates

x1 = np.arange(nx) - nx // 2
y1 = np.arange(ny) - ny // 2
X, Y = np.meshgrid(x1, y1)     #creamos una grilla para las coordenadas

# Convertir las coordenadas cartesianas a coordenadas polares
R = np.sqrt(X**2 + Y**2)
Theta = np.arctan2(Y, X)

# Crear una malla de coordenadas polares
r_max = np.max(R)
nr = ny  # número de puntos en la dirección radial
ntheta = nx  # número de puntos en la dirección angular
r = np.linspace(0, r_max, nr)  #probemos en vez de rmax usar 2*rout y dr=disk_delt es decir dr,2*rout,dr
theta = np.linspace(-np.pi, np.pi, ntheta)   #probemos con cambiar ntheta por 181
R_grid, Theta_grid = np.meshgrid(r, theta)

# Convertir las coordenadas polares de nuevo a cartesianas para la interpolación
X_grid = R_grid * np.cos(Theta_grid)
Y_grid = R_grid * np.sin(Theta_grid)

# Mapear las coordenadas del grid a los índices de la imagen original
X_idx = X_grid + nx // 2
Y_idx = Y_grid + ny // 2

# Realizar la interpolación
polar_image = map_coordinates(image, [Y_idx.ravel(), X_idx.ravel()], order=1).reshape(nr, ntheta)

polar_bounds= (r.min(),r.max(),theta.min(),theta.max())
r_lim, theta_lim= [0,rout],[theta.min(),theta.max()]

# Mostrar la imagen original y la imagen en coordenadas polares
fig, axs = plt.subplots(1, figsize=(7, 5))

axs.imshow(polar_image, cmap= cmap, norm=norm, extent=polar_bounds, aspect='auto', origin='lower')
axs.set_title('Imagen en Coordenadas Polares')
axs.set_xlabel('r')
axs.set_ylabel(r'$\theta$')
axs.set_xlim(0,500)

plt.show()

#procedimiento siguiendo los pasos sugeridos

disk_delt = 3600 * subhd['CDELT2']
nxd = nyd = 1001
i0 = nxd // 2
j0 = nyd // 2
xdisk = (np.arange(nxd)-i0)*(-disk_delt)
ydisk = (np.arange(nyd)-j0)*disk_delt

f= interp2d(xdisk, ydisk, rotated_image, kind='cubic', fill_value=0)

dr= disk_delt
r= np.arange(dr,2*rout,dr)
theta= np.linspace(-180,180,181)
polar_image= np.zeros((theta.size,r.size))
theta_rad= np.deg2rad(theta)

for j in range(theta.size):
  for i in range(r.size):
    xnuevo= r[i]* np.cos(theta_rad[j])
    ynuevo= r[i]* np.sin(theta_rad[j])
    polar_image[j,i]= f(xnuevo,ynuevo)

polar_bounds= (r.min(),r.max(),theta.min(),theta.max())
r_lim, theta_lim= [0,rout],[theta.min(),theta.max()]

#creamos la figura
fig= plt.figure(figsize=(12,8))
ax= fig.add_subplot(111)
im= ax.imshow(polar_image, cmap= cmap, norm=norm, extent=polar_bounds, aspect='auto', origin='lower')
#anadimos los labels y detalles de la imagen
ax.set_xlim(r_lim)
ax.set_ylim(theta_lim)
ax.set_xlabel('r [arcsec]')
ax.set_ylabel('$ theta $ [deg]')
ax.set_title('Imagen en Coordenadas Polares')
# construimos la barra de color
cb= plt.colorbar(im, ax=ax, pad=0.05)
cb.set_ticks([0, 0.2, 0.5, 1.0, 2.0])
cb.set_label('surface brightness [mJy / beam]', rotation=90, labelpad=17)

"""### Perfil radial

En esta parte fue necesario investigar un poco de la formula involucrada que nos permite encontrar el perfil radial en temperatura:
# $\frac{S\cdot c^2}{2\cdot Kb \cdot ν^2 \cdot \Omega}$   

donde la S representa el flujo en mjy, c la velocidad de la luz, Kb la ct de Boltzman, nu la frecuencia de la luz que incide y Omega el area del haz (beam)
al hacer el calculo el flujo S lo multiplicamos por $e^{-26}$ para tener las unidades correctas de Jansky jy
"""

#A continuacion procedemos a graficar el perfil radial en temperatura de brillo

Kb,c= 1.380649e-16, 2.9979e10

Tb= c**2 * 1e-26 *np.mean(polar_image, axis=0) /beam_area / (2*Kb * freq**2)

#tambien calculamos el error para este perfil
Tb_err = c**2 * 1e-26 * np.std(polar_image, axis= 0)/np.sqrt(polar_image.shape[1]) / beam_area / (2 * Kb* freq**2)

#ahora graficamos usando un grafico logaritmico y un fillbetween para rellenar el espacio que enmarca el perfil radial

fig= plt.figure(figsize=(8,5))
ax= fig.add_subplot(111)
ax.fill_between(r,Tb-Tb_err, Tb+Tb_err, color='red',linestyle='dashed')
ax.plot(r,Tb,color='k',label='data')

ax.set_xlim([0,rout])
ax.set_ylim([0.3,100])
ax.set_yscale('log')
ax.set_yticks([1, 10, 100])


#anadimos los labels y detalles de la imagen

ax.set_xlabel('r [arcsec]')
ax.set_ylabel('$T_b \,\,$ [K]')
ax.set_title('Perfil radial de Termperatura')
plt.legend()
plt.grid('on')
plt.show()

