# Cálculo de la masa del planeta
M_p = Σ * r_p**2 * h_r**3

# Mostrar el resultado
#print(f"La masa del planeta es aproximadamente: {M_p:.2e} unidades de masa solar")
M_jupiter = M_p / 1.90e-3
M_jupiter

"""## **Parte 7 Creación de una imagen axisimétrica a partir del perfil radial e inspección de residuos**"""

#en esta parte calculamos el promedio de nuestra imagen polar junto con los indices
#que nois van a permitir hacer el sweep out "barrer en torno al centro"
SBr = np.mean(polar_image, axis=0)

ny_sweep, nx_sweep = rotated_image.shape     #se crea los ejes de la imagen
isweep = np.arange(nx_sweep) - nx_sweep/2
jsweep = np.arange(ny_sweep) - ny_sweep/2
I, J = np.meshgrid(isweep, jsweep)        # hacemos una grilla con los indices
R = np.sqrt(I**2 + J**2) * dr

image_sweep = np.empty((ny_sweep, nx_sweep))     #creamos una imagen vacia
for k,r1 in enumerate(r):
    ind = ((R >= r1-0.5*dr) & (R < r1+0.5*dr))
    image_sweep[ind] = SBr[k]          #rellenamos la matriz de nuestra imagen vacia con los datos q ue corresponden

# intensity limits, and stretch
vmin, vmax = 0.0, 4.0    # these are in mJy/beam units
norm = ImageNormalize(vmin=vmin, vmax=vmax, stretch=AsinhStretch(0.03))

# image plot
gs = GridSpec(1,3, hspace=0.2, top=0.97, left=0.07, right=0.97)
fig = plt.figure(figsize=(16,7))
ax0 = fig.add_subplot(gs[0])
ax1 = fig.add_subplot(gs[1])
ax2 = fig.add_subplot(gs[2])
axes = [ax0, ax1, ax2]

im = ax0.imshow(rotated_image, origin='lower', cmap=cmap, extent=im_bounds, norm=norm, aspect='equal')
imfit = ax1.imshow(image_sweep, origin='lower', cmap=cmap, extent=im_bounds, norm=norm, aspect='equal')
imres = ax2.imshow(10*(rotated_image-image_sweep), origin='lower', cmap=cmap, extent=im_bounds, norm=norm, aspect='equal')

ax0.set_xlim(dRA_lims)
ax0.set_ylim(dDEC_lims)
ax0.set_xlabel('RA offset [arcsec]')
ax0.set_ylabel('DEC offset [arcsec]')
ax0.text(0.05,0.9, 'Deprojected data', color='white', fontsize=16, fontweight='bold', transform=ax0.transAxes)

ax1.set_xlim(dRA_lims)
ax1.set_ylim(dDEC_lims)
ax1.text(0.05,0.9, 'Azimuthally averaged', color='white', fontsize=16, fontweight='bold', transform=ax1.transAxes)

ax2.set_xlim(dRA_lims)
ax2.set_ylim(dDEC_lims)
ax2.text(0.05,0.9, 'Residual (x 10)', color='white', fontsize=16, fontweight='bold', transform=ax2.transAxes)

"""## **Bonus**: Residuos en coordenadas ecuatoriales"""

image_res = rotated_image-image_sweep   #aqui se calculan los residuos de la imagen
xsweep = isweep*(-disk_delt)     #luego lo multiplicamos los sweep por disk_delt para llevarlos a coordenadas
ysweep = jsweep*disk_delt

# function to (linearly) interpolate the map
f = interp2d(xsweep, ysweep, image_res, fill_value=0)

image_res_sky = np.zeros(image.shape)  # creamos la imagen vacia

for j in range(ny):
    for i in range(nx):
        # apply the inverse transformation to get to sky coordinates

        #para llegar a coordenadas del cielo aplicamos la matriz de rotación que usamos al principio para
        #deproyectar la imagen pero esta vez en ves de la inclinacion usamos RAo_shift y DECo-shift
        x = np.cos(PAr)*RAo_shift[i] - np.sin(PAr)*DECo_shift[j]
        y = np.sin(PAr)*RAo_shift[i] + np.cos(PAr)*DECo_shift[j]
        image_res_sky[j,i] = f(x, y)

#ploteamos
# image plot
gs = GridSpec(1,2, hspace=0.2, top=0.97, left=0.07, right=0.97)
fig = plt.figure(figsize=(12,7))
ax0 = fig.add_subplot(gs[0])
ax1 = fig.add_subplot(gs[1])
axes = [ax0, ax1]

im = ax0.imshow(image, origin='lower', cmap=cmap, extent=im_bounds, norm=norm, aspect='equal')
imfit = ax1.imshow(4*image_res_sky, origin='lower', cmap=cmap, extent=im_bounds, norm=norm, aspect='equal')

